    <style>
        :root {
            --header: #04A777;
            --highlight: #cd036d;
            --highlight-text: #fff;
            --text: #1c1d45;
            --background: #fff;
        }

        @media (prefers-color-scheme: dark) {
            :root {
                --header: #2ebdcc;
                --highlight: #2ebdcc;
                --highlight-text: #FAFAFA;
                --text: #FAFAFA;
                --background: #232327;
            }
        }

        html, body {
            margin: 0;
            padding: 0;
            height: 100%;
            background: var(--background);
            font: 100% system-ui;
        }

        a, body {
            color: var(--text)
        }

        h1 {
            color: var(--header)
        }

        body {
            display: grid;
            justify-content: center;
        }

        @media screen and (min-width: 30rem) {
            body {
                align-content: center;
            }
        }

        main {
            max-width: 24rem;
            padding: 1rem;
        }

        #qr-code {
            fill: var(--text);
            margin: 0 -8px;
        }
    </style>
